import React, { useState } from 'react';
import { Box, Paper, Typography } from '@mui/material';

import BasicStaffDataGrid from '../../components/Staffs/StaffsCreate/BasicStaffDataGrid';

const StaffCreateMUi = () => {
  const [staffData, setStaffData] = useState({
    name: '',
    surname: '',
    asma: '',
    unit: '',
    specialization: '',
    rank: '',
    mobile_phone: '',
    work_phone: ''
  });

  const handleInputChange = (data) => {
    const [name, value] = data.target;
    setStaffData({ ...data, [name]: value });
  }

  console.log({ staffData, handleInputChange })
  return (
    <Box component='form' autoComplete="off">
      <Paper sx={{
        p: 3,
        m: 4,
        width: '60rem',
        minWidth: '20rem',
      }} elevation={6}>
        <Box sx={{ marginBottom: '25px' }}>
          <Typography variant='h2' gutterBottom fontWeight='bold' sx={{ color: '#03074f', fontSize: '2rem' }}>
              Στοιχεία Προσωπικού
          </Typography>
        </Box>
        <BasicStaffDataGrid data={staffData} handleInputChange/>
      </Paper>
    </Box>
  )
}

export default StaffCreateMUi;
